import React, { Component } from 'react';

class TargetList extends Component {
    constructor(props) {
        super(props)
        this.state = {

            targets:[]
        }

    }
    render() {
        return (
            <div>
                <div className="text-center">Target List</div>
                <div className="row">
                    <div className="table table-striped table-bordered">
                        <thead>
                            <tr>
                                <th>target Code</th>
                                <th>start date</th>
                                <th>end date</th>
                                <th>Target Name</th>
                                <th>Active</th>
                                <th>Target Remarks</th>
                                <th>Parent Target</th>
                            </tr>

                        </thead>
                        <tbody>
                                this.state.targets.map({
                                    target =>
                                    <tr key={target.targetCode}>
                                    <td>{target.startDate}</td>
                                    <td>{target.endDate}</td>
                                    <td>{target.targetName}</td>
                                    <td>{target.targetRemarks}</td>
                                    <td>{target.parentTarget}</td>
                                    </tr>
                                }
                                    
                                )
                        </tbody>
                    </div>

                </div>
            </div>
        );
    }
}

export default TargetList;
